'use strict';

require('../scss/style.scss');

function _classCallCheck(instance, Constructor) { if (!(instance instanceof Constructor)) { throw new TypeError("Cannot call a class as a function"); } }

var Menu = function Menu(options) {
  var _this = this;

  _classCallCheck(this, Menu);

  this.init = function () {
    _this.Nav.addEventListener('click', _this.handleClick);
  };

  this.close = function () {
    _this.menu.classList.remove('active');
  };

  this.open = function () {
    _this.menu.classList.add('active');
  };

  this.createModal = function () {
    _this.contact = document.getElementById(_this.contactId).cloneNode(true);
    var modal = document.createElement('div');
    modal.classList.add('modal-contact');
    _this.closeContactBtn = _this.closeBtn.cloneNode(true);
    _this.closeContactBtn.classList.add('close-contact');
    _this.contact.appendChild(_this.closeContactBtn);
    _this.menuModal = _this.menu.cloneNode(true);
    // console.log(this.closeBtn,this.menuModal,this.closeContactBtn)
    _this.closeMenuBtn = _this.closeBtn.cloneNode(true);
    _this.closeMenuBtn.classList.add('close-btn');
    _this.menuModal.prepend(_this.closeMenuBtn);
    modal.appendChild(_this.menuModal);
    modal.appendChild(_this.contact);
    modal.addEventListener('click', _this.handleClick);

    return modal;
  };

  this.closeContact = function () {
    _this.body.classList.remove('overflow-hidden');
    _this.modal.classList.remove('active');
    _this.modal.classList.toggle('nav');
  };

  this.openContact = function (isNav) {

    if (!_this.modal) _this.modal = _this.createModal();

    _this.body.classList.add('overflow-hidden');
    _this.modal.classList.add('active');
    _this.modal.classList.add('active');
    if (isNav) _this.modal.classList.add('nav');
    _this.body.appendChild(_this.modal);
  };

  this.handleClick = function (e) {
    // e.preventDefault();
    console.log(e, e.target);
    var target = e.target,
        isLink = e.target.parentElement.nodeName === 'LI';
    // check if is a link and not a button
    if (!isLink) e.preventDefault();

    // mobile menu
    if (window.innerWidth < 864) {

      if (_this.openBtn.contains(target)) _this.open();
      if (_this.closeBtn.contains(target)) _this.close();
    }
    //Desktop
    if (window.innerWidth >= 864) {

      if (_this.openBtn.contains(target)) _this.openContact(true);
      if (_this.cta.contains(target)) _this.openContact(false);
      if (_this.closeBtn.contains(target)) _this.closeContact();
      if (_this.closeContactBtn.contains(target)) _this.closeContact();
      if (_this.closeMenuBtn.contains(target)) _this.closeContact();
      if (_this.modal === target) _this.closeContact();
    }
  };

  this.Nav = document.getElementById(options.nav);
  this.openBtn = document.getElementById(options.open);
  this.closeBtn = document.getElementById(options.close);
  // this.closeBtnContact = document.getElementById(options.close)
  this.menu = document.getElementById(options.menu);
  this.cta = document.getElementById(options.cta);
  this.contactId = options.contact;
  this.body = document.body;
  this.state = false;
};

var nav = new Menu({
  nav: 'mainNavigation',
  menu: 'mainMenu',
  open: 'menuOpen',
  close: 'menuClose',
  cta: 'ctaBtn',
  contact: 'contact'
});

nav.init();

